import React from 'react'
import {
  // styled,
  
  // InputBase,
 
 
  Box, Divider,

  
 
} from "@mui/material";






const Searchbar = () => {
  return (
    <>
       <Box sx={{display: "flex" , backgroundColor:'#fff' ,borderRadius:'100px'}} >
        <Box sx={{flexGrow:1 ,paddingLeft:'20px' , lineHeight:'50px' ,width:'50px'}}>
          <Box > 
            <select>
              <option>
                value 
              </option>
            </select>
          </Box>
         
            
        </Box>
        <Divider orientation="vertical" flexItem />
        <Box sx={{flexGrow:2}}>
          Searchbar
        </Box>

       </Box>

     
      
    </>
  )
}

export default Searchbar
